social_posts.post_text:
Long post! !SCAMMER! 
So I bought a motor from Jerrin Johnson 
@drift_depot , for $2,000 cash whom guarantee the engine was running and tested for leaks and compression along with 90 DAY WARRANTY, he made the arrangements to have the motor shipped down south Sunday night, the next morning I drove it down to @socal_z @socalz_garage where they performed a leak down test. 5/6 cylinders, when placed on tdc on compression stroke, were found to have over 90 percent leakage the best having 60% leakage . I then informed Jerrin over the phone with rudy ( the technician ) that the motor was in bad standings along with pictures. He said he was supposed to get back to me with information to replace the motor but that clearly didn’t happen. I asked for a refund since no motor has been offered or provided, I offered to even drive the motor back up north for convenience. After which he proceeded to to ignore all my phone calls and txt messages instead of working something out and doing what’s right for selling me a bad motor.
